import Card from 'react-bootstrap/Card'

const Item = ({ item }) => {
    return (
        <Card style={{ width: '18rem' }}>
            <h1>{item.name}</h1>
            <p>{item.desc}</p>
            <p>{item.price}</p>
            <button
                classname='btn'
            >
                ADD
            </button>
        </Card>
    );
};

export default Item
